import { useNaviagate } from 'react-router-dom';

function StateTag(props){
  return (<div className="state-tag">
    <i className="fa fa-arrow-left back" aria-hidden="true" onClick= {()=>(props.changePage(props.backTo))}></i>
    <span>{props.page}</span>
  </div>)
}
export default StateTag;
